  [],\n\t\"revision_timestamp\": \"2016-02-26T21:45:43.877950\",\n\t\"name\": \"privacy-preserving-distributed-data-mining\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"Distributed data mining from privacy-sensitive
  multi-party data is likely to play an important role in the next generation of integrated
  vehicle health monitoring systems. For example, consider an airline manufacturer
  [tex]$mathcal{C}$[/tex] manufacturing an aircraft model [tex]$A$[/tex] and selling
  it to five different airline operating companies [tex]$mathcal{V}_1 dots mathcal{V}_5$[/tex].
  These aircrafts, during their operation, generate huge amount of data. Mining this
  data can reveal useful information regarding the health and operability of the aircraft
  which can be useful for disaster management and prediction of efficient operating
  regimes. Now if the manufacturer [tex]$mathcal{C}$[/tex] wants to analyze the performance
  data collected from different aircrafts of model-type [tex]$A$[/tex] belonging to
  different airlines then central collection of data for subsequent analysis may not
  be an option. It should be noted that the result of this analysis may be statistically
  more significant if the data for aircraft model [tex]$A$[/tex] across all companies
  were available to [tex]$mathcal{C}$[/tex]. The potential problems arising out of
  such a data mining scenario are:\",\n\t\"license_title\": \"U.S. Government Work\",\n\t\"extras\":
